import React from 'react';
import './Summary.css';

const Summary = () => {
  return (
    <section className="summary-section">
      <div className="summary-overlay">
        <div className="summary-content">
          <h1>Creative Creations Clothing Company</h1>
          <p>
            Creative Creations Clothing Company was established with a vision to provide best service. We have considerable experience in sourcing and manufacturing of Apparel. “Creative Creations Clothing Company” probably best defines the philosophy behind starting this apparel manufacturing venture. The key differentiator is our ability to provide our customers with innovative business models, processes, and offerings. With three decades of industry experience, our promoter nurtured the dream of taking the ready-made garment business global in a systematic and professional manner. This humble beginning is followed by years of hard work, dedication, and a complete focus on ever-changing market trends and customer requirements.
          </p>
        </div>
      </div>
    </section>
  );
};

export default Summary;
